import { oil, carElectronics, carEngine, carBrake, carRepair,turbo, disassembledCar } from 'images/banners/index';

export type Banner = {
  url: string;
  alt: string;
};

export const banners: Banner[] = [
  {
    url: oil,
    alt: 'Oil change',
  },
  {
    url: carElectronics,
    alt: 'Diagnostic Auto',
  },
  {
    url: carEngine,
    alt: 'Car engine',
  },
  {
    url: disassembledCar,
    alt: 'Car engine',
  },
  {
    url: carBrake,
    alt: 'Change car brakes',
  },
  {
    url: carRepair,
    alt: 'Repair car',
  },
  {
    url: turbo,
    alt: 'Repair car',
  },
];
